import {React, useState} from 'react'
import Button from 'react-bootstrap/Button';


const Modal = () => {
    const[openModal, setopenModal] = useState();
    const MyModal= ()=>{
        return(
            <div>
                <div>
                    <p1>Trinamool Congress leader Mahua Moitra who was expelled
                     vacated her government bungalow in Delhi at 10 am today, January 19, Friday.
                     </p1>
                </div>
               
                     <Button variant="outline-primary" onClick={()=>setopenModal(false)}>Accept it</Button>
            </div>
        )

    }
  return (
    <div>
       <Button variant="outline-primary" onClick={()=>setopenModal(true)}>open Modal</Button>

      {openModal && <MyModal/>}
    </div>
  )
}

export default Modal
